import Form from "./settingsForm";

const SettingsContent = () => {


    var formIdentifier = "UPLOAD_NATIONAL_HOLIDAY"

    return(
        <div className="settingsWrapper">  
            <ul className="settingsPanel">
                <li className="settingsLink" onClick={() => {formIdentifier = "UPLOAD_NATIONAL_HOLIDAY";}}>
                    Upload National Holidays
                </li>
                <li className="settingsLink" onClick={() => {formIdentifier = "MANAGE_NATIONAL_HOLIDAY"; }}>
                    Manage National Holidays
                </li>
            </ul>
            <div>
                <Form formIdentifier={formIdentifier}/>
            </div>
        </div>          

    )
} 
export default SettingsContent;
